column8:
終戦直後子供たちのためにジェラルミン製のパン焼器でパンを焼いたタミさん。<BR>
その煙突型のパン焼を南部鉄器で復元したタミパンクラシック。<BR>
SIセンサー付きのガスコンロやIH調理器、オーブンにも使えます。<BR>
※SIセンサーの鍋なし検知機能への対応となります。<BR>温度検知センサー機能により高温となると弱火または<BR>消火する場合がございます。 <P><FONT size="+1"><B><SPAN class="style1">型番 / F-100<BR>サイズ / 縦24ｃｍｘ横18.2ｘ全高9.3cm<BR>重量 / 3kg<BR>容量 / 0.8L<BR>材質 / 鋳鉄<BR>
